Here’s a small edit from the past few days here at Nazare’ produced by @oceanculturemagazine. Jamie and I have been working hard on ‘The Waves of Life”  documentary these past 6 months. 🤜🤛

We’ve Only had 2 sessions in the water. 
We have massive swells here at the moment with the harbour currently closed for towing due to dangerous conditions. There is a 100ft swell forecast for Sunday but winds are absolutely honking. Sunday night the winds are to back off a little. 
Our next shot at this record is Monday morning. So Fingers crossed we get the conditions we need as it will come down to the wire as we fly out Tuesday night. 

Would like to say a Massive thank you to my fiancé @rachdodwell. You’ve been amazing with your suppport on my quest to catch the biggest wave foiled here at nazare. Love ya to pieces. Rach has also been my spotter from the headland talking with my @axisfoils Team mate and tow partner @rafaeltapialewin whilst towing me.

@rafaeltapialewin thank you for sharing all of your knowledge with me mate. Looking forward to getting amongst it Monday and Tuesday with you💪

Also a massive thank you to our water safety team and @axisfoils team mate @kylericha and partner celia_remedios_ . You guys are an awesome team. Hope we can return your hospitality if you visit Australia.

